import React from "react"
import { makeStyles } from '@material-ui/core/styles';


import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import Button from '@material-ui/core/Button';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import {Link} from "react-router-dom"






const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));

export default function ButtonAppBar() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar position="static">
        <Toolbar>
          <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" className={classes.title}>
            News
          </Typography>
          <Grid item xs={1}>
          <Paper className={classes.paper}> <Button variant="outlined" color="secondary"><Link to="/Home">Home</Link></Button></Paper>
        </Grid>
        <Grid item xs={1}>
          <Paper className={classes.paper}><Button variant="outlined" color="secondary"><Link to="About">About</Link></Button></Paper>
        </Grid>
        <Grid item xs={1}>
          <Paper className={classes.paper}><Button variant="outlined" color="secondary"><Link to="User">User</Link></Button></Paper>
        </Grid>







        </Toolbar>
      </AppBar>



    </div>


  );
}
